    def actions_create_or_update_environment_secret(self, request: operations.ActionsCreateOrUpdateEnvironmentSecretRequest) -> operations.ActionsCreateOrUpdateEnvironmentSecretResponse:
        r"""Create or update an environment secret
        Creates or updates an environment secret with an encrypted value. Encrypt your secret using
        [LibSodium](https://libsodium.gitbook.io/doc/bindings_for_other_languages). You must authenticate using an access
        token with the `repo` scope to use this endpoint. GitHub Apps must have the `secrets` repository permission to use
        this endpoint.
        
        #### Example encrypting a secret using Node.js
        
        Encrypt your secret using the [tweetsodium](https://github.com/github/tweetsodium) library.
        
        ```
        const sodium = require('tweetsodium');
        
        const key = \"base64-encoded-public-key\";
        const value = \"plain-text-secret\";
        
        // Convert the message and key to Uint8Array's (Buffer implements that interface)
        const messageBytes = Buffer.from(value);
        const keyBytes = Buffer.from(key, 'base64');
        
        // Encrypt using LibSodium.
        const encryptedBytes = sodium.seal(messageBytes, keyBytes);
        
        // Base64 the encrypted secret
        const encrypted = Buffer.from(encryptedBytes).toString('base64');
        
        console.log(encrypted);
        ```
        
        
        #### Example encrypting a secret using Python
        
        Encrypt your secret using [pynacl](https://pynacl.readthedocs.io/en/stable/public/#nacl-public-sealedbox) with Python 3.
        
        ```
        from base64 import b64encode
        from nacl import encoding, public
        
        def encrypt(public_key: str, secret_value: str) -> str:
          \"\"\"Encrypt a Unicode string using the public key.\"\"\"
          public_key = public.PublicKey(public_key.encode(\"utf-8\"), encoding.Base64Encoder())
          sealed_box = public.SealedBox(public_key)
          encrypted = sealed_box.encrypt(secret_value.encode(\"utf-8\"))
          return b64encode(encrypted).decode(\"utf-8\")
        ```
        
        #### Example encrypting a secret using C#
        
        Encrypt your secret using the [Sodium.Core](https://www.nuget.org/packages/Sodium.Core/) package.
        
        ```
        var secretValue = System.Text.Encoding.UTF8.GetBytes(\"mySecret\");
        var publicKey = Convert.FromBase64String(\"2Sg8iYjAxxmI2LvUXpJjkYrMxURPc8r+dB7TJyvvcCU=\");
        
        var sealedPublicKeyBox = Sodium.SealedPublicKeyBox.Create(secretValue, publicKey);
        
        Console.WriteLine(Convert.ToBase64String(sealedPublicKeyBox));
        ```
        
        #### Example encrypting a secret using Ruby
        
        Encrypt your secret using the [rbnacl](https://github.com/RubyCrypto/rbnacl) gem.
        
        ```ruby
        require \"rbnacl\"
        require \"base64\"
        
        key = Base64.decode64(\"+ZYvJDZMHUfBkJdyq5Zm9SKqeuBQ4sj+6sfjlH4CgG0=\")
        public_key = RbNaCl::PublicKey.new(key)
        
        box = RbNaCl::Boxes::Sealed.from_public_key(public_key)
        encrypted_secret = box.encrypt(\"my_secret\")
        
        # Print the base64 encoded secret
        puts Base64.strict_encode64(encrypted_secret)
        ```
        https://docs.github.com/rest/reference/actions#create-or-update-an-environment-secret - API method documentation
        """
        
        base_url = self._server_url
        
        url = utils.generate_url(base_url, "/repositories/{repository_id}/environments/{environment_name}/secrets/{secret_name}", request.path_params)
        
        headers = {}
        req_content_type, data, form = utils.serialize_request_body(request)
        if req_content_type != "multipart/form-data" and req_content_type != "multipart/mixed":
            headers["content-type"] = req_content_type
        
        client = self._client
        
        r = client.request("PUT", url, data=data, files=form, headers=headers)
        content_type = r.headers.get("Content-Type")

        res = operations.ActionsCreateOrUpdateEnvironmentSecretResponse(status_code=r.status_code, content_type=content_type)
        
        if r.status_code == 201:
            pass
        elif r.status_code == 204:
            pass

        return res

    
